import React from 'react';
import Slider from 'react-slick';
import styled from 'styled-components';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

const StyledItem = styled.div`
  width: 100px;
  height: 100px;
  // margin: 0 auto;
  background: green;
`;

const TodoTabletElement = () => {
  const settings = {
    // dots: true,
    className: 'center',
    centerPadding: '60px',
    infinite: true,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 1
  };

  return (
    <div>
      <Slider {...settings}>
        <StyledItem>Slide1</StyledItem>
        <StyledItem>Slide2</StyledItem>
        <StyledItem>Slide3</StyledItem>
        <StyledItem>Slide4</StyledItem>
      </Slider>
    </div>
  );
};

export default TodoTabletElement;
